import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Button extends Component {
  render() {
    const { btnText, url, type, disabled, func, css } = this.props;
    if (url) {
      return (<Link to={url} >
        <button className={css}>{btnText}></button>
      </Link>)
    }else if(func){
      return <button className={css} onClick={func}>{btnText}</button>
    }
    else
    {
      return <button className={css} type={type} disabled={disabled}>{btnText}</button>
    }
  }
}
